import React from "react";
import ExpenseItem from "./ExpenseItem";
import "./Expense.css";

const ExpenseList = ({ expenses }) => {
  return (
    <div className="expense">
      {expenses.map((expense) => (
        <ExpenseItem expense={expense} key={expense.id} />
      ))}
    </div>
  );
};

export default ExpenseList;
